// NavBar

import { Link } from "react-router-dom"

const NavBar = () => {

    return(

        <nav className="nav">
            <div className="container">
                <h1 className="logo"><Link to="/">Home My Website</Link></h1>
                <ul>
                    <li> Link to="/">Home</li>
                    <li Link to="/About">About</li>
                    <li Link to="/Contact">Contact</li>
                    <li Link to="/Services">Service</li>
                </ul>
            </div>
        </nav>


    );
}


export default NavBar;
